            <h>React Meals </h>
            <HeaderCartButton onClick={props.onShowCart} />
         </header>
         <div className={classes["main-image"]}>
            <img src={mealsImage} alt="A table fuöö of food" />
         </div>
      </Fragment>
   );
};

